-- Table: estadotiempos_mensuales
CREATE TABLE estadotiempos_mensuales ( 
    fecha           DATE    PRIMARY KEY,
    temp_media      REAL,
    temp_max        REAL,
    temp_min        REAL,
    presion         REAL,
    visibilidad     REAL,
    viento_vel      REAL,
    viento_rafaga   REAL,
    punto_rocio     REAL,
    precipitaciones REAL,
    nieve           REAL,
    flags           NUMERIC,
    sunspots        REAL,
    ninonina        REAL 
);


